-- ----------------------------
-- Triggers structure for table walkie_bill
-- ----------------------------
DROP TRIGGER IF EXISTS `update_bill`;
delimiter ;;
CREATE TRIGGER `update_bill` AFTER UPDATE ON `walkie_bill` FOR EACH ROW BEGIN
	if new.statu = 2 then
		update walkie_user set balance = balance + new.value + new.fee ,frozen = frozen - new.value - new.fee where id = new.userid;
	end if;	
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table walkie_recharge
-- ----------------------------
DROP TRIGGER IF EXISTS `insert_recharge`;
delimiter ;;
CREATE TRIGGER `insert_recharge` AFTER INSERT ON `walkie_recharge` FOR EACH ROW BEGIN

	DECLARE $userid int;
	set $userid = (select userid from walkie_address where address  = new.toadd);
	update walkie_user set balance = balance + new.value where id = $userid;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table walkie_withdraw
-- ----------------------------
DROP TRIGGER IF EXISTS `update_withdraw`;
delimiter ;;
CREATE TRIGGER `update_withdraw` AFTER UPDATE ON `walkie_withdraw` FOR EACH ROW BEGIN
	if new.statu = 1 then
		update walkie_user set frozen = frozen - new.value - new.fee where id = (select userid from walkie_bill where id = new.billid);
	end if;	
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
